class DocumentNode{constructor(e,t,n,r,o){this.id=e,this.level=t,this.name=n,this.parent=r,this.element=o,this.children=[]}}var model=function(){const e=new DocumentNode("",1,"root",null,null),t=e.id,n=[e];return{totalPageNumbers:0,currentPage:1,currentChapterId:t,documentRoot:e,documentStructure:n,documentPageElements:[],getChapterIndexById:function(e){return n.findIndex(t=>t.id===e)}}}();